import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const Home = () => {
    return (
        <View style={styles.home_container}>
            <Text>dfghdfgf</Text>
        </View>
    );
}

const styles = StyleSheet.create({
    home_container: {
        width: '100vw',
        minHeight: '100vh',
        backgroundColor: "#808080"
    }
})

export default Home;
